import sponsor1 from '../images/sponsor-1.jpeg'
import sponsor2 from '../images/sponsor-2jpeg'
import sponsor3 from '../images/sponsor-3.png'
import sponsor4 from '../images/sponsor-4.png'
import sponsor5 from '../images/sponsor-5.jpeg'

const data = {
    "properties": [
        {
            "index":0,
            "picture":sponsor1,
            "alt": "sponsor-1"
        },
        {
            "index":1,
            "picture": sponsor2,
            "alt": "sponsor-2"
        },
        {
            "index":2,
            "picture":sponsor3,
            "alt":"sponsor-3"
        },
        {
            "index":3,
            "picture":sponsor4,
            "alt":"sponsor-4"
        },
        {
            "index":4,
            "picture":sponsor5,
            "alt":"sponsor-5"
        }
    ]
}

export default data;
